// src/components/ProfileTabs/SecurityTab.js
import React from 'react';

const SecurityTab = ({ profileData }) => {
  const handleChangePassword = () => {
    // Implement change password logic
  };

  const handleEnableTwoFactor = () => {
    // Implement two-factor authentication logic
  };

  return (
    <div>
      <h2 className="text-xl font-semibold mb-4">Security Settings</h2>
      <div className="mb-6">
        <button
          onClick={handleChangePassword}
          className="bg-indigo-600 text-white px-4 py-2 rounded hover:bg-indigo-700"
        >
          Change Password
        </button>
      </div>
      <div className="mb-6">
        <label className="flex items-center">
          <input
            type="checkbox"
            checked={profileData?.security?.twoFactorAuthEnabled}
            onChange={handleEnableTwoFactor}
            className="form-checkbox"
          />
          <span className="ml-2">Enable Two-Factor Authentication</span>
        </label>
      </div>
      <h3 className="text-lg font-semibold mb-2">Recent Login Activity</h3>
      <ul className="list-disc pl-5">
        {profileData?.security?.recentLogins.map((login, index) => (
          <li key={index}>
            {login.date} - {login.ip} - {login.location}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SecurityTab;
